class NotPixel:
    def __init__(self, thread: int, session_name: str, phone_number: str, proxy: [str, None]):
        self.account = session_name + '.session'
        self.thread = thread

        self.proxy = f"{config.PROXY['TYPE']['REQUESTS']}://{proxy}" if proxy is not None else None
        connector = ProxyConnector.from_url(self.proxy) if proxy else aiohttp.TCPConnector(verify_ssl=False)

        if proxy:
            proxy = {
                "scheme": config.PROXY['TYPE']['TG'],
                "hostname": proxy.split(":")[1].split("@")[1],
                "port": int(proxy.split(":")[2]),
                "username": proxy.split(":")[0],
                "password": proxy.split(":")[1].split("@")[0]
            }

        self.client = Client(
            name=session_name,
            api_id=config.API_ID,
            api_hash=config.API_HASH,
            workdir=config.WORKDIR,
            proxy=proxy,
        )

        headers = {
            'User-Agent': UserAgent(os='android').random,
        }
        self.session = aiohttp.ClientSession(headers=headers, trust_env=True, connector=connector)

    async def stats(self):
        await asyncio.sleep(random.uniform(*config.DELAYS['ACCOUNT']))
        await self.login()

        me = await self.me()
        balance = round(me.get('balance'), 2)
        league = me.get('league')

        is_beta_tester = "✅" if me.get('isBetaTester') else "❌"
        squad_name = me.get('squad').get('name')
        ref_link = f"https://t.me/notpixel/app?startapp=f{me.get('id')}"
        referrals = me.get('friends')

        r = await (await self.session.get(f'https://notpx.app/api/v1/ratings/personal?league={league}')).json()
        leaderboard = r.get('myPlace')

        await self.logout()

        await self.client.connect()
        me = await self.client.get_me()
        phone_number, name = "'" + me.phone_number, f"{me.first_name} {me.last_name if me.last_name is not None else ''}"
        await self.client.disconnect()

        proxy = self.proxy.replace('http://', "") if self.proxy is not None else '-'

        return [phone_number, name, is_beta_tester, str(balance), str(league), str(leaderboard), str(squad_name),
                str(referrals), str(ref_link), proxy]

    async def upgrade(self, boost_name: str):
        resp = await self.session.get(f'https://notpx.app/api/v1/mining/boost/check/{boost_name}')
        return (await resp.json()).get(boost_name)

    async def upgrades(self, balance: [float, int], boosts: dict):
        while True:
            stop = True
            for key in config.BOOSTERS.keys():
                current_level = boosts[key]
                if not config.BOOSTERS[key]['UPGRADE'] or current_level >= config.BOOSTERS[key]['MAX_LVL']:
                    continue

                upgrade_price = config.BOOSTERS[key]['PRICES'][current_level - 1]
                if upgrade_price > balance: continue

                if await self.upgrade(key):
                    boosts[key] += 1
                    balance -= upgrade_price
                    logger.success(f"Thread {self.thread} | {self.account} | Upgrade {key} to {boosts[key]} level for {upgrade_price}")
                else:
                    logger.warning(f"Thread {self.thread} | {self.account} | Couldn't upgrade {key} to {boosts[key]} level for {upgrade_price}; Balance: {balance}")

                stop = False
            if stop: break

    async def join_tg_chat(self, username: str):
        try:
            async with self.client as client:
                if await client.join_chat(username):
                    return True
        except Exception as e:
            logger.error(f"Thread {self.thread} | {self.account} | Couldn't join to tg chat @{username}: {e}")
            return False

    async def get_pixel_info(self, id_: int):
        resp = await self.session.get(f'https://notpx.app/api/v1/image/get/{id_}')
        r = await resp.json()
        return r

